import React, { Component } from 'react';
import Color from './Color';
import { connect } from 'react-redux'

class Comp1 extends Component {
    state={}
    render() {
        console.log(this.props);
        return (
            <div>
                <table>
                    <tr>
                        <th>Firstname</th>
                        <th>Lastname</th>
                    </tr>
                    <tr>
                        <td>Peter</td>
                        <td>Griffin</td>
                    </tr>
                    <tr>
                        <td>Lois</td>
                        <td>Griffin</td>
                    </tr>
                </table>
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    return { dataFromRedux: state };
}

export default connect()(Color(Comp1));
